// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "../FundsManager.sol";
import "../bops/BopLevelsHandler.sol";
import "../bops/BopToken.sol";
import "../Governance.sol";

/**
 * @title song contract implementation for minimal proxy multiple deployments
 * @author Eric Nordelo
 */
contract Song is Initializable {
    address private immutable _fundsManagerAddress;
    address private immutable _governanceAddress;
    address private immutable _bopTokenAddress;
    address private immutable _traxTokenAddress;

    address private _songsManagerAddress;

    uint256 public id;
    string public genre;

    event SpawnedChildBop(uint64 indexed parentId1, uint64 indexed parentId2);
    modifier onlyBopOwner(uint256 _bopId) {
        address owner = BopToken(_bopTokenAddress).ownerOf(_bopId);
        require(owner == msg.sender, "Invalid owner");
        _;
    }

    constructor(
        address fundsManagerAddress,
        address governanceAddress,
        address bopTokenAddress,
        address traxTokenAddress
    ) {
        _fundsManagerAddress = fundsManagerAddress;
        _governanceAddress = governanceAddress;
        _bopTokenAddress = bopTokenAddress;
        _traxTokenAddress = traxTokenAddress;
    }

    /**
     * @notice initializes the minimal proxy clone
     */
    function initialize(
        uint256 _songId,
        string calldata _genre,
        address songsManagerAddress
    ) external initializer {
        id = _songId;
        genre = _genre;
        _songsManagerAddress = songsManagerAddress;
    }

    /**
     * @notice allows stake coins to receive a bop (trax and stablecoin staking)
     * @param _token the stablecoin token id
     * @param _stablecoinAmount the amount of stablecoin token to stake
     */
    function spawnBop(
        address _token,
        uint256 _stablecoinAmount,
        uint256 _beatsBurnt
    ) external {
        require(_stablecoinAmount > 0, "Invalid amount");

        // configured params in levels handler
        uint256 amountInTrax = BopLevelsHandler(_songsManagerAddress).traxToCreateBop();
        uint256 level = BopLevelsHandler(_songsManagerAddress).startingLevel();

        bool successTraxTransfer = IERC20(_traxTokenAddress).transferFrom(
            msg.sender,
            _fundsManagerAddress,
            amountInTrax
        );
        bool successTokenTransfer = IERC20(_token).transferFrom(
            msg.sender,
            _fundsManagerAddress,
            _stablecoinAmount
        );

        if (!successTraxTransfer || !successTokenTransfer) {
            revert("Fail to transfer");
        }

        // check for the token whitelisting and update the balances in the funds manager
        FundsManager(_fundsManagerAddress).updateSongStaking(amountInTrax, _token, _stablecoinAmount);

       address token = _token;
       uint256 stablecoinAmount = _stablecoinAmount;

        //  mint the Bop
        BopToken(_bopTokenAddress).mint(
            msg.sender,
            id,
            0,
            0,
            genre,
            level,
            _beatsBurnt,
            amountInTrax,
            stablecoinAmount,
            true,
            token
        );
    }

    /**
     * @notice allows stake coins to receive a bop (trax and stablecoin staking)
     * @param _token the stablecoin token id
     * @param _stablecoinAmount the amount of stablecoin token to stake
     */
    function spawnChildBop(
        address _token,
        uint64 _parentId1,
        uint64 _parentId2,
        uint256 _stablecoinAmount,
        uint256 _beatsBurnt
    ) external {
        require(_stablecoinAmount > 0, "Invalid amount");
        require(_beatsBurnt > 0, "Invalid beats");

        // configured params in levels handler
        uint256 amountInTrax = BopLevelsHandler(_songsManagerAddress).traxToCreateBop();
        uint256 level = BopLevelsHandler(_songsManagerAddress).startingLevel();

        bool successTraxTransfer = IERC20(_traxTokenAddress).transferFrom(
            msg.sender,
            _fundsManagerAddress,
            amountInTrax
        );
        bool successTokenTransfer = IERC20(_token).transferFrom(msg.sender, _fundsManagerAddress, _stablecoinAmount);

        if (!successTraxTransfer || !successTokenTransfer) {
            revert("Fail to transfer");
        }

        // check for the token whitelisting and update the balances in the funds manager
        FundsManager(_fundsManagerAddress).updateSongStaking(amountInTrax, _token, _stablecoinAmount);

        address token = _token;
        uint256 stablecoinAmount = _stablecoinAmount;

        // mint the Bop
        BopToken(_bopTokenAddress).mint(
            msg.sender,
            id,
            _parentId1,
            _parentId2,
            genre,
            level,
            _beatsBurnt,
            amountInTrax,
            stablecoinAmount,
            true,
            token
        );

        emit SpawnedChildBop(_parentId1, _parentId2);
    }

    /**
     * @notice allows the unraveling of a bop NFT
     * @param _bopId the token id
     */
    function unravelBop(uint256 _bopId) external onlyBopOwner(_bopId) {
        // get the bop staked quantities from the BopToken contract
        Bop memory bop = BopToken(_bopTokenAddress).getBop(_bopId);

        // get fees from governance and calculate amounts to return
        Governance governance = Governance(_governanceAddress);
        uint256 feeDecimals = governance.FEE_DECIMALS();
        uint256 traxFee = governance.traxUnravelFee();
        uint256 stablecoinFee = governance.stablecoinUnravelFee();

        uint256 traxToReturn = bop.traxStaked - (bop.traxStaked * traxFee) / (100 * 10**feeDecimals);
        uint256 stablecoinToReturn = bop.stablecoinStaked -
            (bop.stablecoinStaked * stablecoinFee) /
            (100 * 10**feeDecimals);

        // burn Bop token (first to avoid posible reentrancy)
        BopToken(_bopTokenAddress).burn(_bopId);

        // call the method to transfer values from the FundsManager contract
        FundsManager(_fundsManagerAddress).transferTraxTo(msg.sender, traxToReturn);
        FundsManager(_fundsManagerAddress).transferStablecoinTo(
            msg.sender,
            bop.stablecoinToken,
            stablecoinToReturn
        );
    }

    /**
     * @notice allows breeding a bop with beats
     * @param _bopId the token id
     * @param _amountOfBeats the token id
     */
    function breedBop(uint256 _bopId, uint256 _amountOfBeats) external onlyBopOwner(_bopId) {
        Governance governance = Governance(_governanceAddress);
        uint256 beatsRequired = governance.breedMinBeats();

        require(_amountOfBeats > beatsRequired, "No enough beats for breeding");

        BopToken(_bopTokenAddress).breedBop(_bopId, _amountOfBeats);
    }

    /**
     * @notice allows withdraw beats generated by a bop
     * @param _bopId the token id
     */
    function withdrawBeatsFrom(uint256 _bopId) external {}

    /**
     * @notice allows to increase the level of a bop with enough beats
     * @param _bopId the bop token id
     */
    function updateLevel(uint256 _bopId) external {}

    /**
     * @notice allows to withdraw the yield from a bop
     * @param _bopId the bop token id
     */
    function getBopYield(uint256 _bopId) external {}
}

